using System;
using System.Collections.Generic;
using System.Linq;
using System.Web;

namespace eidss.openapi.contract
{
    /// <summary>Filter for retrieving a list of Human Case</summary>
    public class HumanCaseListFilter 
    {
        /// <summary>
        /// A unique number of the record
        /// </summary>
        public long? RecordID { get; set; }

        /// <summary>
        /// A number that is assigned to the individual case and automatically generated by EIDSS. The number appears when the case information is saved first time. 
        /// </summary>
        public string CaseID { get; set; }

        /// <summary>
        /// An unique identification number, determined by each country, used to identify the patient.
        /// </summary>
        public string LocalID { get; set; }

        /// <summary>
        /// Patient's Last name
        /// </summary>
        public string PatientLastName { get; set; }

        /// <summary>
        /// Patient's First name
        /// </summary>
        public string PatientFirstName { get; set; }

        /// <summary>
        /// Second name
        /// </summary>
        public string PatientMiddleName { get; set; }

        /// <summary>
        /// Phone number of the patient’s residence.
        /// </summary>
        public string PatientPhoneNumber { get; set; }

        /// <summary>
        /// Name of the facility for patient’s current employer, children’s facility and school if patient is a student.
        /// </summary>
        public string EmployerName { get; set; }

        /// <summary>
        /// An updated condition or disease assigned to the patient that replaces the initial diagnosis. <br/>
        /// Reference number: 19000019<br/>
        /// Reference type: Diagnosis
        /// </summary>
        public long? FinalDiagnosis { get; set; }

        /// <summary>
        /// The initial condition or disease assigned to the case; initial diagnosis that was given when case was notified to the public health agency.<br/>
        /// Reference number: 19000019<br/>
        /// Reference type: Diagnosis
        /// </summary>
        public long? Diagnosis { get; set; }

        /// <summary>
        /// Classification of the case according to surveillance case definitions developed based on the final diagnosis, laboratory tests results and epidemiological information. <br/>
        /// Reference number: 19000011<br/>
        /// Reference type: Case Classification
        /// </summary>
        public long? FinalCaseClassification { get; set; }

        /// <summary>
        /// Status of case information entry into the system. There are two options for this field: In process and Closed. "In process" is the default option. Status should be changed to "Closed", after laboratory and epidemiological investigation is completed and final diagnosis made, thus making all the data fields "read-only".<br/>
        /// Reference number: 19000111<br/>
        /// Reference type: Case Status
        /// </summary>
        public long? CaseStatus { get; set; }


        /// <summary>
        /// The name of facility that received the notification.<br/>
        /// Reference type: Organization Reference
        /// </summary>
        public long? NotificationReceivedByFacility { get; set; }

        /// <summary>
        /// The name of facility that submitted notification to the public health agency.<br/>
        /// Reference type: Organization Reference
        /// </summary>
        public long? NotificationSentByFacility { get; set; }

        /// <summary>
        /// The First, Last and Patronymic name of the person that sent the notification of the occurrence of a disease.<br/>
        /// Reference type: Person Reference
        /// </summary>
        public long? NotificationSentByOfficer { get; set; }

        /// <summary>
        /// The First , Patronymic and Last name of the person that received the notification of the occurrence of a disease.<br/>
        /// Reference type: Person Reference
        /// </summary>
        public long? NotificationReceivedByOfficer { get; set; }

        /// <summary>
        /// Patient’s age type (days, months, years), populated automatically when DOB is entered.<br/>
        /// Reference type: Human Age Type<br/>
        /// Reference number: 19000042
        /// </summary>
        public long? AgeType { get; set; }

        /// <summary>
        /// Male or Female gender of the patient.<br/>
        /// Reference type: Human Gender<br/>
        /// Reference number: 19000043
        /// </summary>
        public long? Sex { get; set; }

        /// <summary>
        /// Nationality or citizenship of the patient that is notified as a case of disease.<br/>
        /// Reference number: 19000054<br/>
        /// Reference type: Nationality List
        /// </summary>
        public long? NationalityCitizenship { get; set; }

        /// <summary>
        /// The outcome of the patients at the time of the discharge from the hospital or final diagnosis made.<br/>
        /// Reference number: 19000064<br/>
        /// Reference type: Case Outcome List
        /// </summary>
        public long? Outcome { get; set; }

        /// <summary>
        /// Hospitalization of the patient for notified condition <br/>
        /// Reference number: 19000100<br/>
        /// Reference type: Yes/No Value List
        /// </summary>
        public long? Hospitalization { get; set; }

        /// <summary>
        /// Country<br/>
        /// Reference type: Country<br/>
        /// Reference number: 19000001
        /// </summary>
        public long? CurrentResidenceCountry { get; set; }

        /// <summary>
        /// Region<br/>
        /// Reference type: Region<br/>
        /// Reference number: 19000002
        /// </summary>
        public long? CurrentResidenceRegion { get; set; }

        /// <summary>
        /// Rayon<br/>
        /// Reference type: Rayon<br/>
        /// Reference number: 19000003
        /// </summary>
        public long? CurrentResidenceRayon { get; set; }

        /// <summary>
        /// Settlement<br/>
        /// Reference type: Settlement<br/>
        /// Reference number: 19000004
        /// </summary>
        public long? CurrentResidenceSettlement { get; set; }

        /// <summary>
        /// Additinoal information and comments to the case
        /// </summary>
        public string AdditionalInformationComments { get; set; }

        /// <summary>
        /// Name of the facility where patient was hospitalized for notified condition.
        /// </summary>
        public string PlaceOfHospitalization { get; set; }

        /// <summary>
        /// Patient’s current age, calculated automatically upon entry of DOB (calculated from Date of Symptom Onset, if it is blank, than - Notification Date, if it is blank, than – Date Entered). If DOB is unknown, user can enter the age of the patient manually to the field.
        /// </summary>
        public int? AgeFrom { get; set; }

        /// <summary>
        /// Patient’s current age, calculated automatically upon entry of DOB (calculated from Date of Symptom Onset, if it is blank, than - Notification Date, if it is blank, than – Date Entered). If DOB is unknown, user can enter the age of the patient manually to the field.
        /// </summary>
        public int? AgeTo { get; set; }

        /// <summary>
        /// The date the case information was first entered into EIDSS. The date is auto populated prior to case information being saved. 
        /// </summary>
        public DateTime? DateEnteredFrom { get; set; }

        /// <summary>
        /// The date the case information was first entered into EIDSS. The date is auto populated prior to case information being saved. 
        /// </summary>
        public DateTime? DateEnteredTo { get; set; }

        /// <summary>
        /// Patient’s date of birth
        /// </summary>
        public DateTime? DateOfBirthFrom { get; set; }

        /// <summary>
        /// Patient’s date of birth
        /// </summary>
        public DateTime? DateOfBirthTo { get; set; }

        /// <summary>
        /// The date the paper case investigation form was completed
        /// </summary>
        public DateTime? DateOfCompletionOfPaperFormFrom { get; set; }

        /// <summary>
        /// The date the paper case investigation form was completed
        /// </summary>
        public DateTime? DateOfCompletionOfPaperFormTo { get; set; }

        /// <summary>
        /// The date when an initial diagnosis was made.
        /// </summary>
        public DateTime? DiagnosisDateFrom { get; set; }

        /// <summary>
        /// The date when an initial diagnosis was made.
        /// </summary>
        public DateTime? DiagnosisDateTo { get; set; }

        /// <summary>
        /// Date when ultimate diagnosis was made. This is a read-only field, populated by the "Date of Diagnosis" or the "Date of Changed Diagnosis"  in the Notification tab after final update.
        /// </summary>
        public DateTime? DateOfFinalDiagnosisFrom { get; set; }

        /// <summary>
        /// Date when ultimate diagnosis was made. This is a read-only field, populated by the "Date of Diagnosis" or the "Date of Changed Diagnosis"  in the Notification tab after final update.
        /// </summary>
        public DateTime? DateOfFinalDiagnosisTo { get; set; }

        /// <summary>
        /// The date of first clinical symptom(s) manifestation in patient,  as recalled by the patient.  
        /// </summary>
        public DateTime? DateOfSymptomOnsetForm { get; set; }

        /// <summary>
        /// The date of first clinical symptom(s) manifestation in patient,  as recalled by the patient.  
        /// </summary>
        public DateTime? DateOfSymptomOnsetTo { get; set; }

        /// <summary>
        /// Date on which a clinic, hospital, office, etc. notifies public health agency about the occurrence of a disease in a subject.
        /// </summary>
        public DateTime? NotificationDateForm { get; set; }

        /// <summary>
        /// Date on which a clinic, hospital, office, etc. notifies public health agency about the occurrence of a disease in a subject.
        /// </summary>
        public DateTime? NotificationDateTo { get; set; }
    }
}